import React from "react";
import Data from "../../components/ProjectsList.json";
// import axios from 'axios';

export default class ProjectsData extends React.Component {
  render() {
    return (
      <div className="card">
        <div className="container-fluid">
        <div className="row">
            {this.state.Data.map((Projects, index) => {
              return (
                <div className="col-sm-4 col-sm-4"
                  key={`product-card-${Projects.id}`}>
                  <div className=" card aSeries">
                    <div className="name">{Projects.name}</div>
                    <div className="photoBg" style={{ backgroundImage: `url(${Projects.img})` }}></div>
                  </div>
                </div>
              );
            })}
          </div>
        </div>
      </div>
    )
  }
}
